import './App.css';

function App() {
  return (
    <div id="menu">
      <button id="mything">
        나의 냉장고
      </button>
      <button id="in">
        재료담기
      </button>
      <button id="my">
        프로필
      </button>
    </div>
  );
}

export default App;
